/*jshint esversion: 6 */
/*jslint bitwise: true */

let {shutdownColor, LightingMode, forcedColor} = [];

let vLedNames = [
	"Led 1", "Led 2", "Led 3", "Led 4", "Led 5", "Led 6", "Led 7", "Led 8", "Led 9", "Led 10", "Led 11", "Led 12",
	"Led 13", "Led 14", "Led 15", "Led 16", "Led 17", "Led 18", "Led 19"];
let vLedPositions = [[5, 0], [4, 0], [1, 0], [0, 2], [0, 3], [0, 4], [0, 5], [1, 6], [3, 6], [4, 6], [5, 6], [6, 6], [7, 6], [8, 5], [8, 4], [8, 2], [8, 0], [7, 0], [6, 0]];

export function Name() { return "Razer FireFly V2"; }
export function VendorId() { return 0x1532; }
export function ProductId() { return 0x0c04; }
export function Publisher() { return "WhirlwindFX"; }
export function Size() { return [9, 7]; }
export function Type() { return "Hid"; }
export function DefaultPosition() {return [240, 120]; }
export function DefaultScale() {return [8.0]; }
export function ControllableParameters() {
	return [
		{"default":"009bde", "label":"Shutdown Color", "max":"360", "min":"0", "property":"shutdownColor", "type":"color" },
		{"default":"Canvas", "label":"Lighting Mode", "property":"LightingMode", "type":"combobox", "values":["Canvas", "Forced"] },
		{"default":"009bde", "label":"Forced Color", "max":"360", "min":"0", "property":"forcedColor", "type":"color" }
	];
}

function CalculateCrc(report) {
	let iCrc = 0;

	for (let iIdx = 3; iIdx < 89; iIdx++) {
		iCrc ^= report[iIdx];
	}

	return iCrc;
}

function hexToRgb(hex) {
	let result = /^#?([a-f\d]{2})([a-f\d]{2})([a-f\d]{2})$/i.exec(hex);
	let colors = [];
	colors[0] = parseInt(result[1], 16);
	colors[1] = parseInt(result[2], 16);
	colors[2] = parseInt(result[3], 16);

	return colors;
}

export function LedNames() {
	return vLedNames;
}

export function LedPositions() {
	return vLedPositions;
}

export function Initialize() {
}

function SendPacket(shutdown = false) {
	let packet = [];
	packet[0] = 0x00;
	packet[1] = 0x00;
	packet[2] = 0x1F;
	packet[3] = 0x00;
	packet[4] = 0x00;
	packet[5] = 0x00;
	packet[6] = 0x3E;
	packet[7] = 0x0F;
	packet[8] = 0x03;
	packet[11] = 0;
	packet[13] = 0x12;

	for(let iIdx = 0; iIdx < vLedPositions.length; iIdx++){
		let iPxX = vLedPositions[iIdx][0];
		let iPxY = vLedPositions[iIdx][1];
		let col;

		if(shutdown){
			col = hexToRgb(shutdownColor);
		}else if (LightingMode === "Forced") {
			col = hexToRgb(forcedColor);
		}else{
			col = device.color(iPxX, iPxY);
		}
		let iLedIdx = (iIdx*3) + 14;
		packet[iLedIdx] = col[0];
		packet[iLedIdx+1] = col[1];
		packet[iLedIdx+2] = col[2];
	}

	packet[89] = CalculateCrc(packet);
	device.send_report(packet, 91);
	device.pause(1); // We need a pause here (between packets), otherwise the ornata can't keep up.
}

export function Render() {
	SendPacket();
}

export function Shutdown() {
}

export function Validate(endpoint) {
	return endpoint.interface === 0 && endpoint.usage === 0x0002;
}

